import React from "react";
import { withStyles } from "@material-ui/core/styles";
import styles from "./styles/CustomLessonEventStyles";

const LessonEvent = ({ event }) => (
  <div>
    <div>{event.title}</div>
    <span>{event.room}</span>
  </div>
);
export default withStyles(styles)(LessonEvent);
